import React from "react";
import './WebsiteHeader.css'
import { useRef } from "react";


import { motion } from 'framer-motion';

const WebsiteHeader = () => {
    const constraintsRef = useRef(null)
    return  (
  <motion.div ref={constraintsRef}>
    <motion.div
      initial={{opacity:0}}
      animate={{opacity:1}}
      onDurationChange={1}
      className="header"
    />
    hello wolrd
  </motion.div>
);
};

export default WebsiteHeader
